import styled from 'styled-components'

const UserImageBox = () => {
    return <Wrapper>
        <Name>Ngô Đức Hùng</Name>
        <Occupation>Developer</Occupation>
        <Image src={'https://www.facebook.com/photo/?fbid=818267498774454&set=pob.100017736341999'} />
    </Wrapper>
}

const Image = styled.img`
background: black;
height: 180px;
width: 180px;
border-radius: 50%;
margin: 10px;
`

const Occupation = styled.div`
margin: 10px;
font-size: 16px;
`

const Name = styled.div`
margin-top: 10px;
font-weight: 500;
font-size: 24px;
text-transform: uppercase;
line-height: 42px;
`

const Wrapper = styled.div`
display: flex;
flex-direction: column;
align-items: center;
padding: 20px;
`

export default UserImageBox
